import React from "react";

import "./MyAddress.scss";

import * as Yup from "yup";
import { MDBCol, MDBRow } from "mdbreact";

const initialValues = {
  b_City: "",
  b_AddressOne: "",
  b_AddressTwo: "",
  b_Country: "",
  b_ZipCode: "",
  b_Phone: "",
  s_City: "",
  s_AddressOne: "",
  s_AddressTwo: "",
  s_Country: "",
  s_ZipCode: "",
  s_Phone: "",
};

const validationSchema = Yup.object().shape({
  b_City: Yup.string().required("Required!"),
  b_AddressOne: Yup.string().required("Required!"),
});

function MyAddress() {
  return (
    <div className="my-address-box border rounded overflow-hidden p-3">
      <h5 className="font-weight-bold">My Address</h5>

      <MDBRow>
        <MDBCol md="6" sm="12" className="mt-3">
          <h6 className="text-muted text-uppercase">billing address</h6>
          <hr />
        </MDBCol>
        <MDBCol md="6" sm="12">
          left
        </MDBCol>
      </MDBRow>
    </div>
  );
}

export default MyAddress;
